        <p>рЃбрЃарЃљрЃЊрЃўрЃфрЃўрЃБрЃџрЃў (On/Off) рЃАрЃўрЃАрЃбрЃћрЃЏрЃћрЃЉрЃўрЃАрЃњрЃљрЃю рЃњрЃљрЃюрЃАрЃ«рЃЋрЃљрЃЋрЃћрЃЉрЃўрЃЌ, рЃАрЃљрЃЊрЃљрЃф рЃЎрЃЮрЃЏрЃърЃарЃћрЃАрЃЮрЃарЃў рЃљрЃю рЃЏрЃБрЃерЃљрЃЮрЃЉрЃА рЃАрЃарЃБрЃџрЃў рЃАрЃўрЃЏрЃФрЃџрЃљрЃЋрЃарЃўрЃЌ, рЃљрЃю рЃњрЃљрЃЏрЃЮрЃарЃЌрЃБрЃџрЃўрЃљ, <strong>рЃўрЃюрЃЋрЃћрЃарЃбрЃЮрЃарЃБрЃџрЃў рЃЎрЃЮрЃЏрЃърЃарЃћрЃАрЃЮрЃарЃў</strong> рЃфрЃЋрЃџрЃўрЃА рЃЉрЃарЃБрЃюрЃЌрЃљ рЃарЃўрЃфрЃ«рЃЋрЃА рЃЊрЃљ рЃерЃћрЃАрЃљрЃЉрЃљрЃЏрЃўрЃАрЃљрЃЊ - рЃАрЃўрЃЏрЃФрЃџрЃљрЃЋрЃарЃћрЃА. рЃћрЃА рЃ«рЃЊрЃћрЃЉрЃљ рЃФрЃарЃљрЃЋрЃўрЃА рЃЎрЃЋрЃћрЃЉрЃўрЃА рЃАрЃўрЃ«рЃерЃўрЃарЃўрЃА рЃфрЃЋрЃџрЃўрЃџрЃћрЃЉрЃўрЃЌ.</p>
        
