            <li><strong>рЃњрЃљрЃЪрЃЮрЃюрЃЋрЃўрЃА рЃерЃћрЃЏрЃЮрЃгрЃЏрЃћрЃЉрЃљ:</strong> 3-30рЃЎрЃњ (12 рЃЌрЃЋрЃћрЃерЃў рЃћрЃарЃЌрЃ«рЃћрЃџ), 30-300рЃЎрЃњ (6 рЃЌрЃЋрЃћрЃерЃў), 300+ (3 рЃЌрЃЋрЃћрЃерЃў).</li>
